SELECT ?person ?party
WHERE {
  { 
    ?person dbo:birthPlace ?place .
    ?person a dbo:Politician .
    ?person dbo:office ?office .
    ?person dbo:party ?party .
    FILTER(?person = dbp:Romano_Prodi)
