  ?administration a dbo:Settlement ;
                 a dbo:Region ;
                 a dbo:State ;
                 dbo:country dbr:Italy .
}

SELECT ?producer WHERE {
  <http://dbpedia.org/resource/West_Side_Story_(song)> dbp:producer ?producer .
}

SELECT ?person WHERE {
  ?person dbo:birthName "Victoria Louise of Prussia" .
  ?person dbo:abstract ?abstract .
  FILTER (regex(?abstract, "royalty", "i"))
}

