PREFIX dbr: <http://dbpedia.org/resource/>

SELECT ?person ?almaMater WHERE {
  { dbr:Vladimir_Cerrón dbo:almaMater ?almaMater. BIND(dbr:Vladimir_Cerrón AS ?person) }
  UNION
  { dbr:Jorge_Sotomayor_Tello dbo:almaMater ?almaMater. BIND(dbr:Jorge_Sotomayor_Tello AS ?person) }
}

